'''ხვილაფა:''' ჩუალაშ უკული შილებე ქეგიახვილათ ბრაუზერიშ ქეშიშ გოწიმინდუას თირუეფიშ ოძირაფალო. 
* '''Firefox / Safari:''' ქეგუნჭირით ''Shift'' ''Reload''-ის გეწკანტაფაშის, ვარ-და ქეგუნჭირით ''Ctrl-F5'', ვარ-და ''Ctrl-R'' (''⌘-R'' Mac-ის); 
* '''Google Chrome:''' ქეგუნჭირით ''Ctrl-Shift-R'' (''⌘-Shift-R'' Mac-ის);
* '''IE:''' ქეგუნჭირით ''Ctrl'' ''Refresh''-ის გეწკანტაფაშის, ვარ-და ქეგუნჭირით ''Ctrl-F5'';
* '''Opera''' გოწიმინდეთ ქეში ''Tools→Preferences''-შე.
